#!/bin/bash
[[ -n $DEBUG ]] && set -x
set -Eeuo pipefail

die() {
    red_echo "$@"
    exit 1
}

cc() {
    local OP=$1
    shift
    local ARGS='{"Args":[]}'
    ARGS=$(jq <<<$ARGS -c ".function=\"$1\"")
    shift
    for ARG in "$@"
    do
        ARG=$(jq -c <<<$ARG . || echo $ARG)
        ARGS=$(jq <<<$ARGS -c '.Args+=[$a]' --arg a $ARG)
    done
    ./tribfed_chaincode_invoke.sh $OP $ARGS
}

invoke() {
    cc invoke "$@"
}

query() {
    cc query "$@"
}

